var questions = function questions() {
  $('.product-dropdown__header').click(function () {
    $(this).siblings('.product-dropdown__content').slideToggle(200);
    $(this).toggleClass('product-dropdown__header--opened');
  });
};

var sandwichMenu = function sandwichMenu() {
  $('.sandwich__open-btn').click(function () {
    $('.sandwich__content').addClass('sandwich__content--opened');
  });
  $('.sandwich__close-btn').click(function () {
    $('.sandwich__content').removeClass('sandwich__content--opened');
  });
};

